import base64
import os

DIR = os.path.dirname(__file__)


in_data_1 = ""

in_data_2 = ""


print("in_data_1 len:", len(in_data_1))
print("in_data_2 len:", len(in_data_2))

out_data_1 = base64.b64decode(in_data_1)
out_data_2 = base64.b64decode(in_data_2)

print("out_data_1 len:", len(out_data_1))
print("out_data_2 len:", len(out_data_2))

for index, char in enumerate(out_data_1):
    if out_data_2[index] != char:
        break

print("out_data_1:", out_data_1[:index])
print("out_data_2:", out_data_2[:index])


with open(os.path.join(DIR,'raw_1'),'wb') as f:
    f.write(out_data_1)

with open(os.path.join(DIR,'raw_2'),'wb') as f:
    f.write(out_data_2)
